-- =====================================================================
-- MAP PERSONAS TO ROLES, FUNCTIONS, AND DEPARTMENTS
-- Generated from PERSONAS_ROW_FULLY_MAPPED.json
-- Total personas to map: 697
-- =====================================================================

BEGIN;

DO $$
DECLARE
    personas_updated INTEGER := 0;
    update_count INTEGER;
BEGIN
    RAISE NOTICE 'â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•';
    RAISE NOTICE 'ğŸ”„ MAPPING PERSONAS TO ROLES, FUNCTIONS, AND DEPARTMENTS';
    RAISE NOTICE 'â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•';
    RAISE NOTICE '';

    -- Create temporary table with mappings
    CREATE TEMP TABLE persona_mappings (
        persona_id uuid PRIMARY KEY,
        role_id uuid,
        function_id uuid,
        department_id uuid
    );

    -- Insert mappings
    ON CONFLICT (persona_id) DO NOTHING;

    RAISE NOTICE 'Inserted % mapping records', 697;

    -- Update personas from mappings
    UPDATE public.personas p
    SET
        role_id = COALESCE(m.role_id, p.role_id),
        function_id = COALESCE(m.function_id, p.function_id),
        department_id = COALESCE(m.department_id, p.department_id),
        updated_at = NOW()
    FROM persona_mappings m
    WHERE p.id = m.persona_id
      AND (
          p.role_id IS DISTINCT FROM m.role_id
          OR p.function_id IS DISTINCT FROM m.function_id
          OR p.department_id IS DISTINCT FROM m.department_id
      );

    GET DIAGNOSTICS update_count = ROW_COUNT;
    personas_updated := update_count;

    RAISE NOTICE '';
    RAISE NOTICE 'â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•';
    RAISE NOTICE 'âœ… MAPPING COMPLETE';
    RAISE NOTICE 'â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•';
    RAISE NOTICE 'Total personas updated: %', personas_updated;

    -- Clean up
    DROP TABLE persona_mappings;

END $$;

COMMIT;

-- =====================================================================
-- VERIFICATION QUERIES
-- =====================================================================

-- Summary statistics
SELECT 
    '=== MAPPING SUMMARY ===' as section;

SELECT 
    COUNT(*) as total_personas,
    COUNT(role_id) as personas_with_role,
    COUNT(function_id) as personas_with_function,
    COUNT(department_id) as personas_with_department,
    COUNT(CASE WHEN role_id IS NOT NULL AND function_id IS NOT NULL AND department_id IS NOT NULL THEN 1 END) as fully_mapped
FROM public.personas
WHERE deleted_at IS NULL;

-- Sample of mapped personas
SELECT 
    '=== SAMPLE MAPPED PERSONAS ===' as section;

SELECT 
    p.name as persona_name,
    p.slug as persona_slug,
    r.name as role_name,
    f.name::text as function_name,
    d.name as department_name
FROM public.personas p
LEFT JOIN public.org_roles r ON p.role_id = r.id
LEFT JOIN public.org_functions f ON p.function_id = f.id
LEFT JOIN public.org_departments d ON p.department_id = d.id
WHERE p.deleted_at IS NULL
  AND (p.role_id IS NOT NULL OR p.function_id IS NOT NULL OR p.department_id IS NOT NULL)
ORDER BY f.name, d.name, r.name, p.name
LIMIT 50;
